const urls = $input.all().map(item => item.json.output.url);

const output = {
  count: 100,
  countryCode: 10,
  scrapeCompany: true,
  urls: urls
};

return [
  {
    json: output
  }
];

// Collect all slugs
const slugs = $input.all().map(item => item.json.slug);

// Remove duplicates
const uniqueSlugs = [...new Set(slugs)];

// Return in required format
return [
  {
    json: {
      identifier: uniqueSlugs
    }
  }
];

const items = $input.all();
const urlMap = {};

// Count each unique URL
for (const item of items) {
  const url = item.json.url;
  if (!url) continue;

  if (urlMap[url]) {
    urlMap[url]++;
  } else {
    urlMap[url] = 1;
  }
}

// Convert counts to output format
const result = Object.entries(urlMap).map(([url, count]) => {
  return { json: { url, count } };
});

return result;

